import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const fetchData = async () => {
    try {
      // TODO: Get current time to identify start and end work hours
      let getCalendarEventsUrl = "https://graph.microsoft.com/v1.0/me/calendarView?startDateTime=2020-07-27T00:00:00.0000000&endDateTime=2020-07-27T23:59:00.0000000&$select=subject,start,end";

      // TODO: Call Login API to fetch Auth Token

      const options = {
        headers: {
        "Authorization": "" //Paste Token from Graph Explorer Access Token tab until the generating auth token part is plugged in
        }
      };

      // Fetching user's calendar data for today
      var response = await fetch(getCalendarEventsUrl, options);
      if(response.status >= 300) {
        throw new Error(response.statusText);
      }

      var body = await response.json();
      var events = body.value;
      events.forEach(element => {
        console.log(element.subject + " : " + element.start.dateTime + " to " + element.end.dateTime);
      });

      // TODO: Scheduling algorithm to indentify free times from the calendar
    } catch (error) {
      console.log("Error in fetching calendar data: " + error.message);
    }
  }
    
  const createEvent = async () => {
    try {
      let addEventUrl = "https://graph.microsoft.com/v1.0/me/events";

      // TODO: Call Login API to fetch Auth Token

      const options = {
        method: "POST",
        body: JSON.stringify(
          {  
            subject: "My event",
            start: {
              dateTime: "2020-07-27T15:00:00.000",
              timeZone: "Pacific Standard Time"
            },
            end: {
              dateTime: "2020-07-27T15:30:00.000",
              timeZone: "Pacific Standard Time"
            },
            responseRequested: true,
            allowNewTimeProposals: true
          }
        ),
        headers: {
          "Authorization": "eyJ0eXAiOiJKV1QiLCJub25jZSI6ImE3VjhiQnRheGI3R0xibHV5UnhGMy1CbjJ2bTNjN09TbE02MlNFdXc0ZU0iLCJhbGciOiJSUzI1NiIsIng1dCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSIsImtpZCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSJ9..Fa_FcHc5-X8IYZlckjCtpTyS_v8NJ_gE-POMo5bqE-iG-6y_P6gup2dd4LxgaNCMogDu8E3BsMVGh5B0zbDbrhFVZGPhqIAbvyKs1Y-3nHJblx1JPIDMWoRo_sn-VQ06dIg1H_vp1Wepwqke7AWmsoZoQYe3MEE5mW9BCaD1vTiLoMmjUoRq24YTnecYvNIRQP9J-H3bZ7BMJxZbvDEAexcE5v3gTUbJBX4Tw6_0rGW-NyyU_W_2nceSl4yQo6ipePjA0ri6PdHu1A2OaffN0Q_vXhBSkkoB0qjbtWdmanQfpLojq9laA2213QAh3URLSZkGidfn2zkO4X4UNfUrQA" //Paste Token from Graph Explorer Access Token tab until the generating auth token part is plugged in
        }
      };

      // TODO: Create calendar event for an identified free time
      var response = await fetch(addEventUrl, {
        method: "POST",
        body: JSON.stringify(
          {  
            subject: "My event",
            start: {
              dateTime: "2020-07-27T15:00:00.000",
              timeZone: "Pacific Standard Time"
            },
            end: {
              dateTime: "2020-07-27T15:30:00.000",
              timeZone: "Pacific Standard Time"
            },
            responseRequested: true,
            allowNewTimeProposals: true
          }
        ),
        headers: {
          "Authorization": "eyJ0eXAiOiJKV1QiLCJub25jZSI6IkVpa2l4UmZiUjhfc1pZN0s4ellEWXRaSGstbEFIRHVwMEd1ZzNFOHpneFUiLCJhbGciOiJSUzI1NiIsIng1dCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSIsImtpZCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSJ9..vJHo2iu0Oa4vjnk2VxaztkySgnVE2qW7GHvh0KRGy53PI63pwYtIiC69z5meU6d-z1QBE7w_3u95oaIEOJyTxcoUIP7zUoOeHPQabQFEZuO7DOTsuxBmJRPP1q9EVZM-buTWtSvAm-I5IxGL04eraWaZItA17Uvdl4PjZgVeAHC4nirAptafEQmmhAOzFr-94HR_oX9MGcrb3MBcuqMZbcCX9lZ5GcxjaofXc73fc-txJF0L8MP98npc-39vA07MdDv2zJ1ba4iIPCOc7fe9UPcd24o12j44Mag4fb_8emAAxMhF_i65emAg0ZlxXvu2D1XPPrmCXGvJDNV0mavwSg" //Paste Token from Graph Explorer Access Token tab until the generating auth token part is plugged in
        }
      });
      console.log(response);
      if(response.status >= 300) {
        throw new Error(response.statusText);
      }
    } catch (error) {
      console.log("Error in creating calendar event: " + error.message);
    }
  }

  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p> */}
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
