        >
          Learn React
        </a>
        <div>
          <button id="fetch" onClick={fetchData}>
            Fetch My Calendar Data
          </button>
          <br/>
          <button id="create" onClick={createEvent}>
            Create an Event in my Calendar
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;
